iv><a class="" href="rpa-twitter.html">RPA.Twitter</a><div></div><a class="" href="rpa-word-application.html">RPA.Word.Application</a><div></div></div><a class="" href="../3rd-party-libraries.html">3rd party libraries<svg width="6" height="10" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M.529.529c.26-.26.682-.26.942 0l4 4c.26.26.26.682 0 .942l-4 4A.667.667 0 11.53 8.53L4.057 5 .53 1.471a.667.667 0 010-.942z" fill="#AFA1C2"></path></svg></a><div></div><a class="" href="../built-in.html">Built-in<svg width="6" height="10" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M.529.529c.26-.26.682-.26.942 0l4 4c.26.26.26.682 0 .942l-4 4A.667.667 0 11.53 8.53L4.057 5 .53 1.471a.667.667 0 010-.942z" fill="#AFA1C2"></path></svg></a><div></div></div><a class="placeholder" href="../../product-manuals/Autosphere.html">Product manuals<svg width="6" height="10" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M.529.529c.26-.26.682-.26.942 0l4 4c.26.26.26.682 0 .942l-4 4A.667.667 0 11.53 8.53L4.057 5 .53 1.471a.667.667 0 010-.942z" fill="#AFA1C2"></path></svg></a><div></div><a class="article" href="../../glossary.html">Glossary</a><div></div><a class="external" href="https://forum.Autosphere.com/" target="_blank" rel="noreferrer"><span>Community<svg width="14" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M10 2.667a.667.667 0 010-1.334h4c.368 0 .667.299.667.667v4a.667.667 0 01-1.334 0V3.61L7.138 9.805a.667.667 0 01-.943-.943l6.195-6.195H10zm-6.667 2a.667.667 0 00-.666.666v7.334a.667.667 0 00.666.666h7.334a.667.667 0 00.666-.666v-4a.667.667 0 011.334 0v4a2 2 0 01-2 2H3.333a2 2 0 01-2-2V5.333a2 2 0 012-2h4a.667.667 0 010 1.334h-4z" fill="#002642"></path></svg></span></a></nav></aside><article class="sc-hBEYos dVNWBU"><div class="sc-kLgntA iHaOcn"><nav class="sc-bYEvPH khGBIg"><a href="../../libraries.html">Keyword libraries</a><svg width="6" height="10" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M.528.529c.26-.26.683-.26.943 0l4 4c.26.26.26.682 0 .942l-4 4a.667.667 0 11-.943-.942L4.057 5 .528 1.471a.667.667 0 010-.942z" fill="#002642"></path></svg><a href="../rpa-framework.html">RPA Framework</a></nav><div class="sc-iktFzd gaGeRK"><h1>RPA.Robocloud.Items</h1></div><nav class="sc-giIncl cuybkK"><a aria-current="page" class="sc-ezrdKe bAYFRD" href="rpa-robocloud-items.html">Readme</a><a class="sc-ezrdKe bAYFRD" href="rpa-robocloud-items/keywords.html">Keywords</a><a class="sc-ezrdKe bAYFRD" href="rpa-robocloud-items/materials.html">Learning materials</a></nav></div><div class="sc-jJEJSO laquCT"><div class="sc-hiSbYr XqbgT"><div>
<p>A library for interacting with RPA work items.</p>
<p>Work items are used for managing data that go through multiple
activities and tasks inside a process. Each execution of an activity receives
a work item from the previous activity, and after the activity is finished, it
is forwarded to the next one. During the execution, it can freely
read and update the data contained in an item.</p>
<p>The default implementation uses Robocloud to store the data, but the library
allows using custom adapters.</p>
<p><strong>Default environment</strong></p>
<p>The library automatically loads the work item defined by its runtime
environment if the argument <tt class="docutils literal">load_env</tt> is truthy (enabled by default).
This functionality is controlled by the following environment variables:</p>
<ul class="simple">
<li><tt class="docutils literal">RC_WORKSPACE_ID</tt>: The ID for the Robocloud workspace</li>
<li><tt class="docutils literal">RC_WORKITEM_ID</tt>:  The ID for the Robocloud work item</li>
</ul>
<p>These values are dynamic and should be set by Robocloud, but can be
overriden manually while developing an activity.</p>
<p><strong>Item structure</strong></p>
<p>A work item's data payload is JSON and allows storing anything that is
serializable. This library creates an object with the key 'variables'
that contains key-value pairs of a variable name and its contents.
These variables can be exposed to the Robot Framework task to be used directly.</p>
<p>In addition to the data section, a work item can also contain files,
which are stored by default in Autosphere's cloud. Adding and using
files with work items requires no additional setup from the user.</p>
<p><strong>Workflow</strong></p>
<p>While a work item is loaded automatically when a suite starts, changes are
not automatically reflected back to the source. The work item will be modified
locally and then saved when the corresponding keyword is explicitly called.
It is recommended to defer all saves to the end of the task to prevent
leaving work items in a half-modified state after failures.</p>
<p><strong>Custom adapters</strong></p>
<p>While Robocloud is the default implementation, it can also be replaced
with a custom adapter. The selection is based on either the <tt class="docutils literal">default_adapter</tt>
argument for the library, or the <tt class="docutils literal">RPA_WORKITEMS_ADAPTER</tt> environment
variable. A custom implementation should inherit from the <tt class="docutils literal">BaseAdapter</tt>
class. The library has a built-in alternative adapter called FileAdapter for
storing work items to disk.</p>
<p><strong>Examples</strong></p>
<p><strong>Robot Framework</strong></p>
<p>In the following example the work item is modified locally and then saved
back to Robocloud. Also note how the work item is loaded implicitly when
the suite starts.</p>
<pre class="code robotframework literal-block"><span class="gh">*** Settings ***</span><span class="p">
</span><span class="kn">Library</span><span class="p">    </span><span class="nn">RPA.Robocloud.Items</span><span class="p">

</span><span class="gh">*** Tasks ***</span><span class="p">
</span><span class="gu">Save variables to Robocloud</span><span class="p">
    </span><span class="nf">Add work item file</span><span class="p">    </span><span class="s">orders.xlsx</span><span class="p">
    </span><span class="nf">Set work item variables</span><span class="p">    </span><span class="s">user=Dude</span><span class="p">    </span><span class="s">mail=address&#64;company.com</span><span class="p">
    </span><span class="nf">Save work item</span>
</pre>
<p>Later in the process inside a different robot, we can use previously saved
work item variables and files. The library also allows injecting the variables
directly into the current task execution.</p>
<pre class="code robotframework literal-block"><span class="gh">*** Settings ***</span><span class="p">
</span><span class="kn">Library</span><span class="p">    </span><span class="nn">RPA.Robocloud.Items</span><span class="p">

</span><span class="gh">*** Tasks ***</span><span class="p">
</span><span class="gu">Use variables from Robocloud</span><span class="p">
    </span><span class="nf">Set task variables from work item</span><span class="p">
    </span><span class="nf">Log</span><span class="p">    </span><span class="s">Variables are now available: </span><span class="p">${</span><span class="nv">user</span><span class="p">}</span><span class="s">, </span><span class="p">${</span><span class="nv">mail</span><span class="p">}
    ${</span><span class="nv">path</span><span class="p">}=    </span><span class="nf">Get work item file</span><span class="p">    </span><span class="s">orders.xlsx</span><span class="p">
    </span><span class="nf">Log</span><span class="p">    </span><span class="s">Files are also stored to disk: </span><span class="p">${</span><span class="nv">path</span><span class="p">}</span>
</pre>
<p><strong>Python</strong></p>
<p>The library can also be used through Python, but it does not implicitly
load the work item for the current execution.</p>
<pre class="code python literal-block"><span class="kn">import</span> <span class="nn">logging</span>
<span class="kn">from</span> <span class="nn">RPA.Robocloud.Items</span> <span class="kn">import</span> <span class="n">Items</span>

<span class="k">def</span> <span class="nf">list_variables</span><span class="p">(</span><span class="n">item_id</span><span class="p">):</span>
    <span class="n">library</span> <span class="o">=</span> <span class="n">Items</span><span class="p">()</span>
    <span class="n">library</span><span class="o">.</span><span class="n">load_work_item_from_environment</span><span class="p">()</span>

    <span class="k">for</span> <span class="n">variable</span><span class="p">,</span> <span class="n">value</span> <span class="ow">in</span> <span class="n">library</span><span class="o">.</span><span class="n">get_work_item_variables</span><span class="p">()</span><span class="o">.</span><span class="n">items</span><span class="p">():</span>
        <span class="n">logging</span><span class="o">.</span><span class="n">info</span><span class="p">(</span><span class="s2">&quot;</span><span class="si">%s</span><span class="s2"> = </span><span class="si">%s</span><span class="s2">&quot;</span><span class="p">,</span> <span class="n">variable</span><span class="p">,</span> <span class="n">value</span><span class="p">)</span>
</pre></div></div><aside class="sc-iJuUWI jaFBcT"><form><h5>Keywords</h5><fieldset class="sc-eCssSg eeeqEu"><input type="text" aria-label="Filter keywords" placeholder="Filter keywords" value=""/><svg width="13" height="13" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M12.327 11.376L8.846 7.9A4.824 4.824 0 107.483 9.26l3.479 3.48s.661.703 1.365 0c.703-.703 0-1.365 0-1.365zM6.87 7.284a2.897 2.897 0 01-4.093 0 2.897 2.897 0 010-4.093 2.897 2.897 0 014.093 0 2.897 2.897 0 010 4.093z" fill="#002642"></path></svg></fieldset></form><div><a id="link-add-work-item-file" href="rpa-robocloud-items/keywords.html#add-work-item-file" class="">Add Work Item File</a><a id="link-add-work-item-files" href="rpa-robocloud-items/keywords.html#add-work-item-files" class="">Add Work Item Files</a><a id="link-clear-work-item" href="rpa-robocloud-items/keywords.html#clear-work-item" class="">Clear Work Item</a><a id="link-delete-work-item-variables" href="rpa-robocloud-items/keywords.html#delete-work-item-variables" class="">Delete Work Item Variables</a><a id="link-get-work-item-file" href="rpa-robocloud-items/keywords.html#get-work-item-file" class="">Get Work Item File</a><a id="link-get-work-item-files" href="rpa-robocloud-items/keywords.html#get-work-item-files" class="">Get Work Item Files</a><a id="link-get-work-item-payload" href="rpa-robocloud-items/keywords.html#get-work-item-payload" class="">Get Work Item Payload</a><a id="link-get-work-item-variable" href="rpa-robocloud-items/keywords.html#get-work-item-variable" class="">Get Work Item Variable</a><a id="link-get-work-item-variables" href="rpa-robocloud-items/keywords.html#get-work-item-variables" class="">Get Work Item Variables</a><a id="link-list-work-item-files" href="rpa-robocloud-items/keywords.html#list-work-item-files" class="">List Work Item Files</a><a id="link-list-work-item-variables" href="rpa-robocloud-items/keywords.html#list-work-item-variables" class="">List Work Item Variables</a><a id="link-load-w